import React, { Component } from "react";
import { Document } from "react-pdf";
import pdf from "../images/pdf/Resume.pdf";

class Resume extends Component {
  render() {
    return (
      <div>
        <Document file="Resume.pdf"></Document>
      </div>
    );
  }
}

export default Resume;
